import {BrowserRouter, Routes, Route} from 'react-router-dom';
import LoginAdm from './pages/LoginAdmin/admin.js';

export default function Index(){
    return(
        <BrowserRouter>
            <Routes>
                <Route path='/'/>
                <Route path='/admin' element={<LoginAdm />} />

            </Routes>
        </BrowserRouter>
    )
}
